/* Parse types from a string or file. See ParseTypes() in idc.py */
int idc_parse_types(const char *input, int flags)
{
  int hti = ((flags >> 4) & 7) << HTI_PAK_SHIFT;

  if ( (flags & 1) != 0 )
    hti |= HTI_FIL;

  return parse_decls(NULL, input, (flags & 2) == 0 ? msg : NULL, hti);
}

