  ADD_OR_NONE(fields != NULL, IDAPyStr_FromUTF8((const char *) fields));
  ADD_OR_NONE(cmt != NULL, IDAPyStr_FromUTF8(cmt));
  ADD_OR_NONE(field_cmts != NULL, IDAPyStr_FromUTF8((const char *) field_cmts));
